%[text] # Exercise 3: Publish your code to GitHub
%[text] In this exercise, you'll publish your complete Workshop files to GitHub, making your work accessible to the world and contributing to the global conversation on climate solutions.
%[text] **Why Publish to GitHub?**
%[text] Publishing your climate engineering work to GitHub allows you to:
%[text] - Share your carbon footprint analysis tools with others
%[text] - Inspire people to take climate action based on data
%[text] - Showcase your MATLAB and engineering skills
%[text] - Contribute to open-source climate solutions
%[text] - Document your learning journey at MATLAB EXPO 2025 \
%[text] GitHub serves as your professional portfolio and enables collaboration on climate solutions at scale.
%[text] ### MATLAB Online Git Integration
%[text] MATLAB Online R2025b now has built-in GitHub integration: MATLAB Online provides seamless integration with GitHub, making it easy to version control your work without leaving the MATLAB environment.
%[text] **Step 1: Create your GitHub account** 
%[text] In case you don't have a GitHub account, visit this page and follow the process
%[text]{"align":"center"} [https](https://github.com/signup)[://github.com/](https://github.com/signup)[signup](https://github.com/signup) 
%[text] 
%[text] **Step 2: Generate a personal access token (classic) in your GitHub account**
%[text] You can follow the instructions here:  [https://docs.github.com/en/authentication/keeping-your-account-and-data-secure/managing-your-personal-access-tokens\#creating-a-personal-access-token-classic](https://docs.github.com/en/authentication/keeping-your-account-and-data-secure/managing-your-personal-access-tokens#creating-a-personal-access-token-classic) 
%[text] ![](text:image:0269)
%[text] **Step 3:  Initialize the Git Repository for your workshop folder**
%[text] Right click in your folder and select Source Control \> Initialize Git Repository
%[text] **Step 4:** **Create Your First Commit** 
%[text] **Step 5: Push to GitHub**
%[text] 

